import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 65.2-903 Records not public.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/65.2-903.md","filePath":"vacode/65.2-903.md"}'),o={name:"vacode/65.2-903.md"},a=i('<h1 id="§-65-2-903-records-not-public" tabindex="-1">§ 65.2-903 Records not public. <a class="header-anchor" href="#§-65-2-903-records-not-public" aria-label="Permalink to &quot;§ 65.2-903 Records not public.&quot;">​</a></h1><p>The records of the Commission, insofar as they refer to accidents, injuries and settlements, shall not be open to the public but only to the parties satisfying the Commission of their interest in such records and their right to inspect them; however, the Commission shall make its records about an injured employee available to the Virginia Employment Commission, the Department of Social Services, or the Virginia Retirement System if any such entity requests such records. The Commission shall promulgate rules to ensure that information for the purpose of determining eligibility for employment shall not be provided without the written consent of the employee.</p><p>Code 1950, § 65-119; 1968, c. 660, § 65.1-128; 1991, c. 355; 1993, c. 806; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0457" target="_blank" rel="noreferrer">457</a>; 1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0796" target="_blank" rel="noreferrer">796</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0895" target="_blank" rel="noreferrer">895</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0693" target="_blank" rel="noreferrer">693</a>.</p>',3),n=[a];function s(l,c,h,p,d,m){return t(),r("div",null,n)}const u=e(o,[["render",s]]);export{_ as __pageData,u as default};
